                    { 2375, "JLPT1", "入学式が<b>待ち遠しい</b>です。", "入学式[にゅうがくしき]が<b> 待[ま]ち 遠[どお]しい</b>です。", "にゅうがくしき が <b>まちどおしい</b> です", "I cant wait for the entrance ceremony.", "1e6a842127eee54267cabaf5c85fd15b.mp3", "待ち遠しい", "待[ま]ち 遠[どお]しい", "まちどおしい", "'just cant wait for, long for'", "Adjective", "df1bfa10aeff8eaa55a2313dfff758d9.mp3" },
