                    { 2377, "JLPT0", "最近、銀行の<b>金利</b>が少し上がった。", "最近[さいきん]、 銀行[ぎんこう]の<b> 金利[きんり]</b>が 少[すこ]し 上[あ]がった。", "さいきん ぎんこう の <b>きんり</b> が すこし あがった", "'Recently, the banks interest rates were raised.'", "ac4029b715290db167c867905b7d9ba8.mp3", "金利", "金利[きんり]", "きんり", "'interest, interest rate'", "Noun", "8a3219361e9800461b5334e09d276bc5.mp3" },
                    { 2378, "JLPT2", "勝利するには<b>法則</b>があるそうだ。", "勝利[しょうり]するには<b> 法則[ほうそく]</b>があるそうだ。", "しょうり する に は <b>ほうそく</b> が ある そう だ", "I heard that there are rules to follow in order to win.", "d2fcf2aa6a1ad2f75cebe327394743f6.mp3", "法則", "法則[ほうそく]", "ほうそく", "'law, rule'", "Noun", "5a54b2f8628cafa142756f39aa2413bd.mp3" },
                    { 2379, "JLPT2", "先月の<b>利益</b>は200万円でした。", "先月[せんげつ]の<b> 利益[りえき]</b>は200 万円[まんえん]でした。", "せんげつ の <b>りえき</b> は 200 まんえん でした", "Last months profit was two million yen.", "9d9bc17ef388196da24c609e1b7354c4.mp3", "利益", "利益[りえき]", "りえき", "'profit, benefit'", "Noun", "54804bc8a7bbf587391a4b2450994708.mp3" },
                    { 2380, "JLPT1", "昨日の話し合いは<b>有益</b>でした。", "昨日[きのう]の 話[はな]し 合[あ]いは<b> 有益[ゆうえき]</b>でした。", "きのう の はなしあい は <b>ゆうえき</b> でした", "Yesterdays discussion was beneficial.", "b0638788e2bf6708d8de06988e9dfd69.mp3", "有益", "有益[ゆうえき]", "ゆうえき", "'beneficial, profitable'", "Adjectival Noun", "dde5c059bb2b9bc2daa156ea3db22633.mp3" },
                    { 2381, "JLPT1", "このメーカーの製品は高<b>品質</b>だわね。", "このメーカーの 製品[せいひん]は 高[こう]<b> 品質[ひんしつ]</b>だわね。", "この めーかー の せいひん は こう<b>ひんしつ</b> だ わ ね", "The products from this manufacturer are high-quality.", "6999c5161d91255273822dd78461d3cc.mp3", "品質", "品質[ひんしつ]", "ひんしつ", "quality", "Noun", "37e76599e9f400f47f585ecc338d3d2a.mp3" },
                    { 2382, "JLPT2", "私は木造の<b>家屋</b>が好きです。", "私[わたし]は 木造[もくぞう]の<b> 家屋[かおく]</b>が 好[す]きです。", "わたし は もくぞう の <b>かおく</b> が すき です", "I like houses built of wood.", "e4f9899764d9d902b2570665d9b4cbd2.mp3", "家屋", "家屋[かおく]", "かおく", "'house, building'", "Noun", "9e4b4bf49b1ea42d5c34e1f123cc986d.mp3" },
                    { 2383, "JLPT0", "この仕事には<b>少なくとも</b>2週間必要でしょう。", "この 仕事[しごと]には<b> 少[すく]なくとも</b> 2週間必要[にしゅうかん ひつよう]でしょう。", "この しごと に は <b>すくなくとも</b> にしゅうかん ひつよう でしょう", "At least two weeks will be needed for this job.", "b9fec7d28d323ca61d872aeeb03e43af.mp3", "少なくとも", "少[すく]なくとも", "すくなくとも", "at least", "Adverb", "877b9cd23ea98498330d291e9fbc3a77.mp3" },
                    { 2384, "JLPT0", "<b>あらかじめ</b>必要な物を書き出して下さい。", "<b>あらかじめ</b> 必要[ひつよう]な 物[もの]を 書[か]き 出[だ]して 下[くだ]さい。", "<b>あらかじめ</b> ひつよう な もの を かきだして ください", "Please write down in advance what you need.", "e2f33b5795aeb41d6d2ee550bb1eac87.mp3", "あらかじめ", "あらかじめ", "あらかじめ", "in advance", "Adverb", "5209e9da8e40d00b9f8e68c8b1e943d5.mp3" },
                    { 2385, "JLPT2", "この仕事には何日必要か<b>見当</b>もつかないね。", "この 仕事[しごと]には 何日必要[なんにち ひつよう]か<b> 見当[けんとう]</b>もつかないね。", "この しごと に は なんにち ひつよう か <b>けんとう</b> も つかない ね", "I cant predict how many days are needed for this job.", "575348c9942baa636498999598ad0f08.mp3", "見当", "見当[けんとう]", "けんとう", "'estimate, aim'", "Noun", "b06e26804ba2b198cdda7572016c6e15.mp3" },
                    { 2386, "JLPT2", "荷物が多いので大きな<b>入れ物</b>が必要です。", "荷物[にもつ]が 多[おお]いので 大[おお]きな<b> 入[い]れ 物[もの]</b>が 必要[ひつよう]です。", "にもつ が おおい の で おおき な <b>いれもの</b> が ひつよう です", "There are so many items that we need a big container.", "c7643bbbd322ca9c0badd0bacc0e50ce.mp3", "入れ物", "入[い]れ 物[もの]", "いれもの", "'receptacle, container'", "Noun", "03afe4f866a209e21e220704860ea672.mp3" },
                    { 2387, "JLPT2", "話の<b>要点</b>だけ教えてください。", "話[はなし]の<b> 要点[ようてん]</b>だけ 教[おし]えてください。", "はなし の <b>ようてん</b> だけ おしえて ください", "Please tell me just the main points of the talk.", "cf725240b6f0bf10877e32032194c484.mp3", "要点", "要点[ようてん]", "ようてん", "'main point, gist'", "Noun", "75c34846a031d0edf9fd393b26610262.mp3" },
                    { 2388, "JLPT1", "仕事には<b>慣れ</b>も必要です。", "仕事[しごと]には<b> 慣[な]れ</b>も 必要[ひつよう]です。", "しごと に は <b>なれ</b> も ひつよう です", "Getting used to the work is also necessary in any job.", "1af03ffcfbe3ee988421351abd586592.mp3", "慣れ", "慣[な]れ", "なれ", "'getting used to, habituation'", "Noun", "384cbe70bddf64e300714b0a0cd1cc7b.mp3" },
                    { 2389, "JLPT1", "xの<b>値</b>を求めなさい。", "x[えっくす]の<b> 値[あたい]</b>を 求[もと]めなさい。", "えっくす の <b>あたい</b> を もとめなさい", "Calculate the value of x.", "dbd7fa09538b1982d47b4e95a3489cf0.mp3", "値", "値[あたい]", "あたい", "'value, worth'", "Noun", "2302f4622b402a602ebfe75a3ed5c5ac.mp3" },
