                    { 2391, "JLPT2", "<b>会計</b>を済ませて店を出たんだ。", "<b> 会計[かいけい]</b>を 済[す]ませて 店[みせ]を 出[で]たんだ。", "<b>かいけい</b> を すませて みせ を でた ん だ", "I payed the bill and then left the shop.", "2b5bc1da5210c9eb550c2c4edf558f10.mp3", "会計", "会計[かいけい]", "かいけい", "'account, finance'", "Noun", "d182a8cd43132b9dced1d774636876c8.mp3" },
