                    { 2394, "JLPT2", "都心と地方では収入に大きな<b>差</b>があるね。", "都心[としん]と 地方[ちほう]では 収入[しゅうにゅう]に 大[おお]きな<b> 差[さ]</b>があるね。", "としん と ちほう で は しゅうにゅう に おおき な <b>さ</b> が ある ね", "There is a big difference in income between rural and urban areas.", "4e36cb24c8f484e6e8840f7d34b0cd0f.mp3", "差", "差[さ]", "さ", "difference", "Noun", "9bdf33f1eaa223bbb6512fe7eb757a38.mp3" },
                    { 2395, "JLPT1", "日本とフランスの<b>時差</b>は8時間です。", "日本[にほん]とフランスの<b> 時差[じさ]</b>は 8時間[はちじかん]です。", "にほん と ふらんす の <b>じさ</b> は はちじかん です", "The time difference between Japan and France is eight hours.", "8daec4ee3a7ab725b2e133b7414f0c33.mp3", "時差", "時差[じさ]", "じさ", "time difference", "Noun", "72d957569b8b9608a925ae6c6c821589.mp3" },
