                    { 2397, "JLPT2", "<b>一昨日</b>、お電話を差し上げました。", "<b> 一昨日[いっさくじつ]</b>、お 電話[でんわ]を 差[さ]し 上[あ]げました。", "<b>いっさくじつ</b> おでんわ を さしあげました", "I gave you a call the day before yesterday.", "86a54eb9f12514035fdb0eafac2f00fd.mp3", "一昨日", "一昨日[いっさくじつ]", "いっさくじつ", "the day before yesterday", "Noun", "1c87ec80b3cf0753e2b6b3f3dd5888ba.mp3" },
