                    { 2400, "JLPT2", "30センチの<b>物差し</b>をください。", "30センチの<b> 物差[ものさ]し</b>をください。", "30 せんち の <b>ものさし</b> を ください", "Please give me a 30 centimeter ruler.", "5b824caca85570189bb2d03920cb110d.mp3", "物差し", "物差[ものさ]し", "ものさし", "ruler", "Noun", "977d1f3f0daef7e70c9495db6b610d60.mp3" },
                    { 2401, "JLPT0", "<b>学割</b>だとだいぶ安いな。", "<b> 学割[がくわり]</b>だとだいぶ 安[やす]いな。", "<b>がくわり</b> だ と だいぶ やすい な", "It is quite cheap with a student discount.", "81aeb71ad197377a017f2b7586e217a7.mp3", "学割", "学割[がくわり]", "がくわり", "student discount", "Noun", "7142990e72c1fde0897bf812d3dcd735.mp3" },
