                    { 2406, "JLPT0", "今回のテストは<b>割合に</b>簡単でした。", "今回[こんかい]のテストは<b> 割合[わりあい]に</b> 簡単[かんたん]でした。", "こんかい の てすと は <b>わりあいに</b> かんたん でした", "This test was relatively easy.", "5f190683e8e482728ee058918c8a0e95.mp3", "割合に", "割合[わりあい]に", "わりあいに", "'relatively, rather'", "Adverb", "3369effaa2b83fa570a8b68c784d5242.mp3" },
