                    { 2408, "JLPT2", "食べ物を残しては<b>もったいない</b>わよ。", "食[た]べ 物[もの]を 残[のこ]しては<b>もったいない</b>わよ。", "たべもの を のこして は <b>もったいない</b> わ よ", "Its wasteful to leave food.", "4793ed111ed85dcf1ed325b1e732db96.mp3", "もったいない", "もったいない", "もったいない", "'wasteful, a shame'", "Adjective", "51247fdecd07567659f1d39da01cf319.mp3" },
