                    { 2455, "JLPT2", "午後は<b>外出</b>の予定です。", "午後[ごご]は<b> 外出[がいしゅつ]</b>の 予定[よてい]です。", "ごご は <b>がいしゅつ</b> の よてい です", "I plan to go out this afternoon.", "85319a3119f0b557a67cc0bd56a5f3b1.mp3", "外出", "外出[がいしゅつ]", "がいしゅつ", "outing", "Verbal Noun", "d529cb6b9844532e4bec0846fbb93b39.mp3" },
