                    { 2458, "JLPT2", "<b>予報</b>では明日は雨ですね。", "<b> 予報[よほう]</b>では 明日[あした]は 雨[あめ]ですね。", "<b>よほう</b> で は あした は あめ です ね", "It will rain tomorrow according to the forecast.", "049d8f7ecb23d440d0f51d01dbf2e433.mp3", "予報", "予報[よほう]", "よほう", "'forecast, prediction'", "Verbal Noun", "03de3d0006567f26ed503a9a1c0bafa3.mp3" },
                    { 2459, "JLPT0", "予約を<b>キャンセル</b>したよ。", "予約[よやく]を<b>キャンセル</b>したよ。", "よやく を <b>きゃんせる</b> した よ", "I canceled the reservation.", "5aacb7684f60cc209e89291c96a69e00.mp3", "キャンセル", "キャンセル", "キャンセル", "cancellation", "Verbal Noun", "a6efb4c3e7e66c97c9863f906ae0ec86.mp3" },
