                    { 2461, "JLPT2", "<b>せめて</b>これだけは約束してください。", "<b>せめて</b>これだけは 約束[やくそく]してください。", "<b>せめて</b> これ だけ は やくそく して ください 。", "Please promise only this at least.", "6376c01a94654e271db85fc616e83af8.mp3", "せめて", "せめて", "せめて", "at least", "Adverb", "b52e18c4b482287bba751c16b5d11477.mp3" },
