                    { 2463, "JLPT1", "これからは経営の合理化を<b>図りたい</b>と思います。", "これからは 経営[けいえい]の 合理化[ごうりか]を<b> 図[はか]りたい</b>と 思[おも]います。", "これから は けいえい の ごうりか を <b>はかりたい</b> と おもいます", "From now on I want to attempt to streamline management.", "d87688f2327a5dbce1199143e7c64bf4.mp3", "図る", "図[はか]る", "はかる", "'strive for, attempt'", "Verb", "5c00abbaa3015eadec1d76b99138ec66.mp3" },
                    { 2464, "JLPT2", "予定が<b>変更</b>になりました。", "予定[よてい]が<b> 変更[へんこう]</b>になりました。", "よてい が <b>へんこう</b> に なりました", "The schedule has been changed.", "842bbe4d7a6825d3788569d710c2fd66.mp3", "変更", "変更[へんこう]", "へんこう", "'alteration, change'", "Verbal Noun", "0d5d0de3a296c96708f709fb6e21f687.mp3" },
                    { 2465, "JLPT0", "最近の子供たちは<b>夜更かし</b>です。", "最近[さいきん]の 子供[こども]たちは<b> 夜更[よふ]かし</b>です。", "さいきん の こども たち は <b>よふかし</b> です", "These days children stay up till late.", "40f20b931d2b3e58c28fb5522541eec8.mp3", "夜更かし", "夜更[よふ]かし", "よふかし", "sitting up late at night", "Verbal Noun", "d8b06d37ac34fdd3d4bb2612ade8c81b.mp3" },
                    { 2466, "JLPT0", "最近ヨガをやる人が<b>急増</b>しています。", "最近[さいきん]ヨガをやる 人[ひと]が<b> 急増[きゅうぞう]</b>しています。", "さいきん よが を やる ひと が <b>きゅうぞう</b> して います", "'Recently, theres been a sudden rise in the number of people doing yoga.'", "2e79083c79eb18691bfba1c19cc381a6.mp3", "急増", "急増[きゅうぞう]", "きゅうぞう", "sudden increase", "Verbal Noun", "c6f006e8b396a5eafa74c6bdb4c6bbf4.mp3" },
                    { 2467, "JLPT2", "大雨で川の水かさが<b>増している</b>な。", "大雨[おおあめ]で 川[かわ]の 水[みず]かさが<b> 増[ま]している</b>な。", "おおあめ で かわ の みずかさ が <b>まして いる</b> な", "The river swells because of the downpour.", "efdd7c6da19b9a732572c9dd6f0d69b1.mp3", "増す", "増[ま]す", "ます", "'increase, augment'", "Verb", "644a2251704883246530f66e7455269b.mp3" },
                    { 2468, "JLPT2", "生産コスト<b>増大</b>のため、値上げします。", "生産[せいさん]コスト<b> 増大[ぞうだい]</b>のため、 値上[ねあ]げします。", "せいさん こすと <b>ぞうだい</b> の ため ねあげ します", "Prices are rising because production costs are increasing.", "668c07c47591df83394429baf226ae99.mp3", "増大", "増大[ぞうだい]", "ぞうだい", "'increase, enlargement'", "Verbal Noun", "2384e797c7e5a1750c92d81e68b8c792.mp3" },
                    { 2469, "JLPT0", "東京の人口は<b>年々</b>増えています。", "東京[とうきょう]の 人口[じんこう]は<b> 年々[ねんねん]</b> 増[ふ]えています。", "とうきょう の じんこう は <b>ねんねん</b> ふえて います", "The population of Tokyo increases year by year.", "e96b0656e59d4a65b60ef0794da7be08.mp3", "年々", "年々[ねんねん]", "ねんねん", "'year by year, annually'", "Adverb", "eb413d0a23c9a40d13f28cfc24fb20f5.mp3" },
                    { 2470, "JLPT1", "この国は人口が<b>減少</b>しているわね。", "この 国[くに]は 人口[じんこう]が<b> 減少[げんしょう]</b>しているわね。", "この くに は じんこう が <b>げんしょう</b> して いる わ ね", "The population of this country is decreasing.", "72b14c95cdb137b69cd8570a0fc0cc14.mp3", "減少", "減少[げんしょう]", "げんしょう", "'decrease, reduction'", "Verbal Noun", "92c35dfdc02c8441e8a4481f98b2405f.mp3" },
                    { 2471, "JLPT2", "最近はテレビを見る<b>回数</b>が減りました。", "最近[さいきん]はテレビを 見[み]る<b> 回数[かいすう]</b>が 減[へ]りました。", "さいきん は てれび を みる <b>かいすう</b> が へりました", "I watch TV less frequently these days.", "3bcf7d9ce3eab80b5c65c21e6b512438.mp3", "回数", "回数[かいすう]", "かいすう", "'frequency, number of times'", "Noun", "b97bd328b28b3865725788d8a482a948.mp3" },
                    { 2472, "JLPT2", "この数年、体重は<b>増減</b>していません。", "この 数年[すうねん]、 体重[たいじゅう]は<b> 増減[ぞうげん]</b>していません。", "この すうねん たいじゅう は <b>ぞうげん</b> して いません", "My weight has not increased or decreased for several years.", "4e0701f9ab92f7da61627d0e507db1f5.mp3", "増減", "増減[ぞうげん]", "ぞうげん", "'increase and decrease, rise and fall'", "Verbal Noun", "ada32563e9791535efbbcfe436192055.mp3" },
