                    { 2475, "JLPT1", "あの駅で学生がたくさん<b>乗り込んだ</b>ね。", "あの 駅[えき]で 学生[がくせい]がたくさん<b> 乗[の]り 込[こ]んだ</b>ね。", "あの えき で がくせい が たくさん <b>のりこんだ</b> ね", "A lot of students got on board at that station.", "29e2c0dd49647031e096df788ca1a24e.mp3", "乗り込む", "乗[の]り 込[こ]む", "のりこむ", "'board, march into'", "Verb", "f026272112089990c23c3a4c9eda619b.mp3" },
                    { 2476, "JLPT0", "私は毎朝<b>ラッシュ</b>の電車に乗っています。", "私[わたし]は 毎朝[まいあさ]<b>ラッシュ</b>の 電車[でんしゃ]に 乗[の]っています。", "わたし は まいあさ <b>らっしゅ</b> の でんしゃ に のって います", "I take the train during rush hour every morning.", "54f0d3cc742fe6f9654f89cd2d1b73e1.mp3", "ラッシュ", "ラッシュ", "ラッシュ", "'rush, rush hour'", "Noun", "158f28735a24242a8ff05f7aba76bc11.mp3" },
