                    { 2478, "JLPT0", "各地で<b>大雨</b>が降っています。", "各地[かくち]で<b> 大雨[おおあめ]</b>が 降[ふ]っています。", "かくち で <b>おおあめ</b> が ふって います", "Heavy rain is falling in all regions.", "b9219ffe01dbb1831ec0a3e8b29b1dfd.mp3", "大雨", "大雨[おおあめ]", "おおあめ", "heavy rain", "Noun", "0a53bd49910514eaf6c5893fbc71c202.mp3" },
                    { 2479, "JLPT2", "<b>今にも</b>雨が降りそうですね。", "<b> 今[いま]にも</b> 雨[あめ]が 降[ふ]りそうですね。", "<b>いまにも</b> あめ が ふりそう です ね", "It looks like its going to rain any moment now.", "cc67eff684c2e0181afce7616fdf5dd3.mp3", "今にも", "今[いま]にも", "いまにも", "at any moment", "Adverb", "ec01d9059f84d8badb41d4fb7b76e668.mp3" },
                    { 2480, "JLPT0", "<b>雨降り</b>で月が見えなかったね。", "<b> 雨降[あめふ]り</b>で 月[つき]が 見[み]えなかったね。", "<b>あめふり</b> で つき が みえなかった ね", "We couldnt see the moon because of the rain.", "4607ee7d1478443727ad2c212d400d34.mp3", "雨降り", "雨降[あめふ]り", "あめふり", "'rainfall, rainy weather'", "Noun", "992331507cb912f3f7025c18dd3272db.mp3" },
