                    { 2482, "JLPT0", "この駅でたくさんの人が<b>乗り降り</b>しますね。", "この 駅[えき]でたくさんの 人[ひと]が<b> 乗[の]り 降[お]り</b>しますね。", "この えき で たくさん の ひと が <b>のりおり</b> します ね", "A huge number of people get on and off at this station.", "2eccffa37a9e1b48538f891d1f557a44.mp3", "乗り降り", "乗[の]り 降[お]り", "のりおり", "getting on and off", "Verbal Noun", "c8c1bb7fadbdc388bc17527939ac0cde.mp3" },
