                    { 2487, "JLPT2", "屋上に<b>アンテナ</b>が立っていますね。", "屋上[おくじょう]に<b>アンテナ</b>が 立[た]っていますね。", "おくじょう に <b>あんてな</b> が たって います ね", "The antenna stands on the rooftop.", "6c3efe5cf3790433389fa10d07d40720.mp3", "アンテナ", "アンテナ", "アンテナ", "antenna", "Noun", "96f0dde41e5944a0219d7da4daec6182.mp3" },
