                    { 2531, "JLPT2", "<b>勝負</b>はまだ始まったばかりよ。", "<b> 勝負[しょうぶ]</b>はまだ 始[はじ]まったばかりよ。", "<b>しょうぶ</b> は まだ はじまった ばかり よ", "The match has just started.", "03d5bdc5441260cea54f1f841fec5d72.mp3", "勝負", "勝負[しょうぶ]", "しょうぶ", "match", "Verbal Noun", "ad4e5b544d2c113d092f27f793dbf4ee.mp3" },
                    { 2532, "JLPT2", "新<b>学期</b>が始まったね。", "新[しん]<b> 学期[がっき]</b>が 始[はじ]まったね。", "しん<b>がっき</b> が はじまった ね", "A new semester has started.", "270217a6e8d2ba9385ad04dcf3afb66d.mp3", "学期", "学期[がっき]", "がっき", "school term", "Noun", "4218b47a98e2615b99cb6f71f7668320.mp3" },
