                    { 2534, "JLPT0", "会社の始業時間に<b>ぎりぎり</b>で間に合ったよ。", "会社[かいしゃ]の 始業時間[しぎょうじかん]に<b>ぎりぎり</b>で 間[ま]に 合[あ]ったよ。", "かいしゃ の しぎょうじかん に <b>ぎりぎり</b> で まにあった よ", "I just made it in time for the start of work.", "5fdb3d8a7e1d4370f58d15d92e99cf21.mp3", "ぎりぎり", "ぎりぎり", "ぎりぎり", "'just in time, barely'", "Adverb", "d116d4406dcdd924216ed72f0b770a5a.mp3" },
                    { 2535, "JLPT2", "<b>大通り</b>でパレードが始まるよ。", "<b> 大通[おおどお]り</b>でパレードが 始[はじ]まるよ。", "<b>おおどおり</b> で ぱれーど が はじまる よ", "The parade starts in the main street.", "b991096adbd803ec4d5b0b1bd52c3adb.mp3", "大通り", "大通[おおどお]り", "おおどおり", "main street", "Noun", "9f3752ec4c705f41324a517a2d0ada09.mp3" },
