                    { 2537, "JLPT1", "昨日、<b>生理</b>が始まったの。", "昨日[きのう]、<b> 生理[せいり]</b>が 始[はじ]まったの。", "きのう <b>せいり</b> が はじまった の", "My period started yesterday.", "77861e7f90da9d433395635c4693f6c8.mp3", "生理", "生理[せいり]", "せいり", "'period, menstruation'", "Noun", "c846d60e2b408570b08106c6b92b71af.mp3" },
                    { 2538, "JLPT0", "今日から<b>新学期</b>が始まります。", "今日[きょう]から<b> 新学期[しんがっき]</b>が 始[はじ]まります。", "きょう から <b>しんがっき</b> が はじまります", "The new semester starts today.", "10ad99f581873d6016d9f06edd7f63e5.mp3", "新学期", "新学期[しんがっき]", "しんがっき", "'new term, new semester'", "Noun", "0410bf394facfa1106af1c8f33433383.mp3" },
                    { 2539, "JLPT2", "多くの<b>文明</b>は川の近くで始まった。", "多[おお]くの<b> 文明[ぶんめい]</b>は 川[かわ]の 近[ちか]くで 始[はじ]まった。", "おおく の <b>ぶんめい</b> は かわ の ちかく で はじまった", "A lot of civilizations started by a river.", "958d8197ee88e10f8dd636ce5b69797b.mp3", "文明", "文明[ぶんめい]", "ぶんめい", "'civilization, culture'", "Noun", "60a16d2ea48ad1a67fd1844f8428f84b.mp3" },
                    { 2540, "JLPT2", "東京行きの<b>最終</b>電車は何時ですか。", "東京行[とうきょうゆ]きの<b> 最終[さいしゅう]</b> 電車[でんしゃ]は 何時[なんじ]ですか。", "とうきょうゆき の <b>さいしゅう</b> でんしゃ は なんじ です か", "What time is the last train for Tokyo?", "b21c718ff75acb1f66e2d943523336f2.mp3", "最終", "最終[さいしゅう]", "さいしゅう", "'last, final'", "Noun", "e09f4d6998fbe19b5d214814b039b39f.mp3" },
                    { 2541, "JLPT2", "電車の<b>終点</b>で降りました。", "電車[でんしゃ]の<b> 終点[しゅうてん]</b>で 降[お]りました。", "でんしゃ の <b>しゅうてん</b> で おりました", "I got off at the terminal.", "181f117d44a544b3f2d7064c69bf0da6.mp3", "終点", "終点[しゅうてん]", "しゅうてん", "'last stop, terminus'", "Noun", "c39bf0d9aacc728d5c0712910300ff41.mp3" },
                    { 2542, "JLPT2", "その部屋は<b>始終</b>、人が出入りしているね。", "その 部屋[へや]は<b> 始終[しじゅう]</b>、 人[ひと]が 出入[でい]りしているね。", "その へや は <b>しじゅう</b> ひと が でいり して いる ね", "People keep going in and out of the room.", "c2d91dbdbd887b7e9c46264d19031ce6.mp3", "始終", "始終[しじゅう]", "しじゅう", "'from beginning to end, at all times'", "Adverb", "6fcf7abaec57b378c3f1977fc0490d67.mp3" },
                    { 2543, "JLPT0", "<b>終電</b>にやっと間に合った。", "<b> 終電[しゅうでん]</b>にやっと 間[ま]に 合[あ]った。", "<b>しゅうでん</b> に やっと まにあった", "I was just in time for the last train.", "06afb6005d19839749a07b7f726e57ed.mp3", "終電", "終電[しゅうでん]", "しゅうでん", "last train", "Noun", "6f78bb6165bc569e0936a1cd9410b8ae.mp3" },
                    { 2544, "JLPT2", "<b>会</b>は午後9時に終わりました。", "<b> 会[かい]</b>は 午後9時[ごご くじ]に 終[お]わりました。", "<b>かい</b> は ごご くじ に おわりました", "The meeting ended at 9:00 pm.", "028b5899bdb17b667cb4c808b31698be.mp3", "会", "会[かい]", "かい", "'meeting, association'", "Noun", "48b79c90db7d6984e8ea4e570fc9d2f3.mp3" },
                    { 2545, "JLPT3", "<b>なるべく</b>早く仕事を終わらせてください。", "<b>なるべく</b> 早[はや]く 仕事[しごと]を 終[お]わらせてください。", "<b>なるべく</b> はやく しごと を おわらせて ください", "Please complete your work as early as possible.", "2fa0fb8414191a3031e7332432cce078.mp3", "なるべく", "なるべく", "なるべく", "'as...as possible, if possible'", "Adverb", "612446ec96886e133937c938e54ae827.mp3" },
                    { 2546, "JLPT2", "私は無事に<b>役目</b>を終えたよ。", "私[わたし]は 無事[ぶじ]に<b> 役目[やくめ]</b>を 終[お]えたよ。", "わたし は ぶじ に <b>やくめ</b> を おえた よ", "I completed the duties without incident.", "29b664bd414ff15f9c9b0912133e3eb5.mp3", "役目", "役目[やくめ]", "やくめ", "'duty, role'", "Noun", "34aecc5b7d4a7f14a2eeca9299ba2613.mp3" },
                    { 2547, "JLPT1", "<b>現地</b>の天気は雨です。", "<b> 現地[げんち]</b>の 天気[てんき]は 雨[あめ]です。", "<b>げんち</b> の てんき は あめ です", "The local weather is rain.", "11021793a1383b46a6232dd762846737.mp3", "現地", "現地[げんち]", "げんち", "'actual site, in the field'", "Noun", "dddce4fea03a51d814be2c902f202b41.mp3" },
                    { 2548, "JLPT2", "事故<b>現場</b>には入れません。", "事故[じこ]<b> 現場[げんば]</b>には 入[はい]れません。", "じこ <b>げんば</b> に は はいれません", "You cant enter the accident scene.", "88dd42550c52e46ba9d00a76ca16dde1.mp3", "現場", "現場[げんば]", "げんば", "'actual spot, job site'", "Noun", "03b56b20a15ae2a4b55b3a801ed04306.mp3" },
                    { 2549, "JLPT0", "ここには<b>現住所</b>を書いてください。", "ここには<b> 現住所[げんじゅうしょ]</b>を 書[か]いてください。", "ここ に は <b>げんじゅうしょ</b> を かいて ください", "Please write your current address here.", "3757e316b87458c86518ee0c853d8af0.mp3", "現住所", "現住所[げんじゅうしょ]", "げんじゅうしょ", "present address", "Noun", "5c919dab823f38b57a0224d84b68d0d0.mp3" },
                    { 2550, "JLPT2", "<b>とにかく</b>現場へ行ってみましょう。", "<b>とにかく</b> 現場[げんば]へ 行[い]ってみましょう。", "<b>とにかく</b> げんば へ いって みましょう", "'Anyway, lets go to the site.'", "71826015d6983c154e9b38d7eaa4afa9.mp3", "とにかく", "とにかく", "とにかく", "'in any case, anyway'", "Adverb", "4a96507f5fcef0f8da4123a56b66fbcc.mp3" },
                    { 2551, "JLPT2", "今日は料理の<b>実習</b>があった。", "今日[きょう]は 料理[りょうり]の<b> 実習[じっしゅう]</b>があった。", "きょう は りょうり の <b>じっしゅう</b> が あった", "Today we had cooking practice.", "d94bc6244cf67649ca18055a184c82dc.mp3", "実習", "実習[じっしゅう]", "じっしゅう", "'practice, training'", "Verbal Noun", "3fbf6dfa7da800aa56b74e28f6082db5.mp3" },
                    { 2552, "JLPT1", "ボールが速過ぎて<b>受け止められなかった</b>の。", "ボールが 速過[はや す]ぎて<b> 受[う]け 止[と]められなかった</b>の。", "ぼーる が はや すぎて <b>うけとめられ なかった</b> の", "The ball was so fast that I couldnt catch it.", "c8672bf78fd200b2e5875cf77ac5447c.mp3", "受け止める", "受[う]け 止[と]める", "うけとめる", "'catch, receive'", "Verb", "bbd606d62ea8e3b5506877365389ec82.mp3" },
                    { 2553, "JLPT2", "私がこの世に<b>生</b>を受けて80年が過ぎたわ。", "私[わたし]がこの 世[よ]に<b> 生[せい]</b>を 受[う]けて 80年[はちじゅうねん]が 過[す]ぎたわ。", "わたし が このよ に <b>せい</b> を うけて はちじゅうねん が すぎた わ", "More than 80 years have passed since I came into this world.", "976df5aa7fc62f42f56cd9df690280c8.mp3", "生", "生[せい]", "せい", "life", "Noun", "50980201e211fd9f834624631dfa9b99.mp3" },
                    { 2554, "JLPT2", "休みの日は家で<b>のんびり</b>過ごします。", "休[やす]みの 日[ひ]は 家[うち]で<b>のんびり</b> 過[す]ごします。", "やすみ の ひ は うち で <b>のんびり</b> すごします", "I spend my days off relaxing at home.", "e58b1c8329851810142a40e72751dca4.mp3", "のんびり", "のんびり", "のんびり", "take it easy", "Adverb", "490da802aecdc9019fd6c9bb70bbe0f2.mp3" },
                    { 2555, "JLPT1", "去年の<b>データ</b>を見せてください。", "去年[きょねん]の<b>データ</b>を 見[み]せてください。", "きょねん の <b>でーた</b> を みせて ください 。", "Please show me last years data.", "fa72af5c37c49ae31824187efb397d13.mp3", "データ", "データ", "データ", "data", "Noun", "7580b5f69d6c96740c362128c60ca428.mp3" },
                    { 2556, "JLPT2", "明日は<b>いよいよ</b>出発の日です。", "明日[あす]は<b>いよいよ</b> 出発[しゅっぱつ]の 日[ひ]です。", "あす は <b>いよいよ</b> しゅっぱつ の ひ です", "At last we will set off tomorrow.", "ca4f74abb646b4bb6f9efc8ac3e44266.mp3", "いよいよ", "いよいよ", "いよいよ", "'finally, any moment'", "Adverb", "c2bfbdf8222c99afa4daac3387e89152.mp3" },
                    { 2557, "JLPT0", "では、私たちは<b>先に</b>出発します。", "では、 私[わたし]たちは<b> 先[さき]に</b> 出発[しゅっぱつ]します。", "では わたしたち は <b>さきに</b> しゅっぱつ します", "'Right, we will set off before you.'", "5787e5c83b7bdcec3256b2e3a6e32c60.mp3", "先に", "先[さき]に", "さきに", "'before, ahead'", "Adverb", "5c19e6c80f6755ed9e4d449ffd99015b.mp3" },
                    { 2558, "JLPT1", "<b>始発</b>の電車に乗りました。", "<b> 始発[しはつ]</b>の 電車[でんしゃ]に 乗[の]りました。", "<b>しはつ</b> の でんしゃ に のりました", "I took the first train.", "30d2780c272aecadb024bbe6b6457757.mp3", "始発", "始発[しはつ]", "しはつ", "first departure", "Noun", "73b98f2ee6611c02b0aecd8375b59b9b.mp3" },
                    { 2559, "JLPT1", "私たちは出発を1日<b>遅らした</b>の。", "私[わたし]たちは 出発[しゅっぱつ]を 1日[いちにち]<b> 遅[おく]らした</b>の。", "わたしたち は しゅっぱつ を いちにち <b>おくらした</b> の", "We delayed our departure one day.", "0fef6f7e7c1b98505205505aa3dfa7ba.mp3", "遅らす", "遅[おく]らす", "おくらす", "'delay, put off'", "Verb", "cbc6afaf04dd1b918888c2013f450e05.mp3" },
                    { 2560, "JLPT2", "新しい車が<b>発売</b>された。", "新[あたら]しい 車[くるま]が<b> 発売[はつばい]</b>された。", "あたらしい くるま が <b>はつばい</b> された", "A new car was put on the market.", "2d00a561f3d99074951f18eb82401c09.mp3", "発売", "発売[はつばい]", "はつばい", "'sale, selling'", "Verbal Noun", "a8d6cac5a42841c187e9827ac87916b9.mp3" },
                    { 2561, "JLPT2", "日本は<b>鉄道</b>がとても発達しています。", "日本[にっぽん]は<b> 鉄道[てつどう]</b>がとても 発達[はったつ]しています。", "にっぽん は <b>てつどう</b> が とても はったつ して います", "The railway system in Japan is well developed.", "f6f3b2a38f093532cc0ef54913ec677c.mp3", "鉄道", "鉄道[てつどう]", "てつどう", "railway", "Noun", "dd57ab2b281a60853c7065866fdeac45.mp3" },
                    { 2562, "JLPT0", "すぐそこに<b>発電所</b>があります。", "すぐそこに<b> 発電所[はつでんしょ]</b>があります。", "すぐ そこ に <b>はつでんしょ</b> が あります", "Theres a power plant near here.", "305822b8467f07017c89d92380d6c9a6.mp3", "発電所", "発電所[はつでんしょ]", "はつでんしょ", "'power plant, generating station'", "Noun", "e4de6377e7661a65eb187b525abd0c93.mp3" },
                    { 2563, "JLPT2", "<b>重大</b>な発表があります。", "<b> 重大[じゅうだい]</b>な 発表[はっぴょう]があります。", "<b>じゅうだい</b> な はっぴょう が あります", "I have an important announcement.", "337e278ef43bdbcca9d2b49497b9a4ea.mp3", "重大", "重大[じゅうだい]", "じゅうだい", "'important, serious'", "Adjective", "45fde5588d1307857d84fbc0ea7c9288.mp3" },
                    { 2564, "JLPT0", "この気持ちをうまく<b>言い表わせません</b>。", "この 気持[きも]ちをうまく<b> 言[い]い 表[あら]わせません</b>。", "この きもち を うまく <b>いいあらわせません</b>", "I cant express this feeling well.", "8da4dc293d01c073d2bc3340caa8fe9c.mp3", "言い表わす", "言[い]い 表[あら]わす", "いいあらわす", "'express, say'", "Verb", "7bf0cbead46f5ec1bd21fdec466a9e74.mp3" },
                    { 2565, "JLPT2", "<b>県</b>の代表は2名です。", "<b> 県[けん]</b>の 代表[だいひょう]は 2名[にめい]です。", "<b>けん</b> の だいひょう は にめい です", "There are two representatives of the prefecture.", "5c825613e4aba09caa21f5438ff4557d.mp3", "県", "県[けん]", "けん", "prefecture", "Noun", "3c6f33e07be7d551f32b9205f56f9f6f.mp3" },
                    { 2566, "JLPT2", "先生が手紙を<b>下さいました</b>。", "先生[せんせい]が 手紙[てがみ]を<b> 下[くだ]さいました</b>。", "せんせい が てがみ を <b>くださいました</b>", "The teacher gave me a letter.", "e86222c06a0ab2c34314d149e22ad75f.mp3", "下さる", "下[くだ]さる", "くださる", "'give, favor with'", "Verb", "21dbc08633f198ff99f2224ae1c9a1d9.mp3" },
