                    { 3466, "JLPT0", "<b>おばさん</b>、こんにちは。", "<b>おばさん</b>、こんにちは。", "<b>おばさん</b>、こんにちは。", "Good afternoon (addressed to a familiar middle-aged woman).", "1aecddb2ead9d19fdf52ed891c9d9c7d.mp3", "おばさん", "おばさん", "おばさん", "middle-aged woman", "Noun", "17bc2b1aa684f493adfea82ec8633365.mp3" },
