                    { 3468, "JLPT2", "毎朝7時5分に<b>出勤</b>します。", "毎朝7時5分[まいあさ しち じ ご ふん]に<b> 出勤[しゅっきん]</b>します。", "まいあさ しち じ ご ふん に <b>しゅっきん</b> します", "I go to work at 7:05 every morning.", "a5e21d96c6c4306b13f100f7b63841be.mp3", "出勤", "出勤[しゅっきん]", "しゅっきん", "'to go to work, attendance at work'", "Verbal Noun", "5f80cbcf57ebfb1c14ff9722f21a0627.mp3" },
                    { 3469, "JLPT1", "彼は<b>運送</b>会社に勤めているの。", "彼[かれ]は<b> 運送[うんそう]</b> 会社[がいしゃ]に 勤[つと]めているの。", "かれ は <b>うんそう</b> がいしゃ に つとめて いる の", "He works for a transportation company.", "7780de0279a8a27f732280acae8b6e30.mp3", "運送", "運送[うんそう]", "うんそう", "'shipping, transportation'", "Verbal Noun", "059f27e1a15e23fcd5af254e5058b475.mp3" },
                    { 3470, "JLPT1", "彼は<b>勤勉</b>な人です。", "彼[かれ]は<b> 勤勉[きんべん]</b>な 人[ひと]です。", "かれ は <b>きんべん</b> な ひと です", "He is a diligent person.", "cf850498d1fba5232e0d346045c706ae.mp3", "勤勉", "勤勉[きんべん]", "きんべん", "'diligence, hard work'", "Adjectival Noun", "5a96b403bea7ef5ddd06cdcc68208a63.mp3" },
                    { 3471, "JLPT0", "私は通勤に<b>JR</b>を使うんだ。", "私[わたし]は 通勤[つうきん]に<b> JR[じぇいあーる]</b>を 使[つか]うんだ。", "わたし は つうきん に <b>じぇいあーる</b> を つかう ん だ", "I commute by JR.", "b56399cc28d3a8f09bab06fbda70cca7.mp3", "ＪＲ", "ＪＲ[じぇいあーる]", "じぇいあーる", "'JR, Japan Railways'", "Noun", "0c6d591b571acf7141abe0962abcd642.mp3" },
                    { 3472, "JLPT0", "今月は出勤<b>日数</b>が多いです。", "今月[こんげつ]は 出勤[しゅっきん]<b> 日数[にっすう]</b>が 多[おお]いです。", "こんげつ は しゅっきん <b>にっすう</b> が おおい です", "Im working many days this month.", "312a11bedb2987f1877cb0998194dbba.mp3", "日数", "日数[にっすう]", "にっすう", "number of days", "Noun", "bbbf716aee67b4eeaf7cc37d40116398.mp3" },
                    { 3473, "JLPT1", "私の<b>勤め先</b>にご連絡ください。", "私[わたし]の<b> 勤[つと]め 先[さき]</b>にご 連絡[れんらく]ください。", "わたし の <b>つとめさき</b> に ごれんらく ください", "Please contact my office.", "bc392218882bb698759aaacc0e677abf.mp3", "勤め先", "勤[つと]め 先[さき]", "つとめさき", "employment", "Noun", "296b59d6d302c54ade35007926a9a0b4.mp3" },
                    { 3474, "JLPT2", "来月で<b>勤め</b>をやめます。", "来月[らいげつ]で<b> 勤[つと]め</b>をやめます。", "らいげつ で <b>つとめ</b> を やめます", "Ill quit my job next month.", "42542dcef115a1bf0b5f842b6bdb9cb6.mp3", "勤め", "勤[つと]め", "つとめ", "'service, duties'", "Noun", "4267de085af5ce1ce28a1a8458cb2c6b.mp3" },
                    { 3475, "JLPT2", "<b>もしかしたら</b>来年転勤になるかも知れない。", "<b>もしかしたら</b> 来年転勤[らいねん てんきん]になるかも 知[し]れない。", "<b>もしかしたら</b> らいねん てんきん に なる かも しれない", "Its possible that I might be transferred next year.", "12b0c59861379e52067360b3ca6999aa.mp3", "もしかしたら", "もしかしたら", "もしかしたら", "'possibly, perhaps'", "Adverb", "b69dd4574fe1b20f5bfd09a0992ca802.mp3" },
