                    { 3477, "JLPT2", "<b>事務</b>の経験が3年あります。", "<b> 事務[じむ]</b>の 経験[けいけん]が 3年[さんねん]あります。", "<b>じむ</b> の けいけん が さんねん あります", "I have three years experience in clerical work.", "367151e255328ef7b50e4efea300e65f.mp3", "事務", "事務[じむ]", "じむ", "'office duty, clerical work'", "Noun", "b9b1d486362dc0d84c1edf53bd1e1091.mp3" },
                    { 3478, "JLPT3", "私の父は<b>公務員</b>です。", "私[わたし]の 父[ちち]は<b> 公務員[こうむいん]</b>です。", "わたし の ちち は <b>こうむいん</b> です", "My father is a civil servant.", "da3a885a197a9f121712f59eb9345734.mp3", "公務員", "公務員[こうむいん]", "こうむいん", "'public officer, government worker'", "Noun", "52e85c277b8e763dae70d8cfef4a9fcb.mp3" },
                    { 3479, "JLPT0", "新しい<b>事務員</b>が入りました。", "新[あたら]しい<b> 事務員[じむいん]</b>が 入[はい]りました。", "あたらしい <b>じむいん</b> が はいりました", "A new clerk joined the office.", "3394638623c25ff4b3e5bf71b8268839.mp3", "事務員", "事務員[じむいん]", "じむいん", "'clerk, clerical staff'", "Noun", "66abd8e8cce950c2d9c35ad5c2f21145.mp3" },
