                    { 3481, "JLPT1", "会社は<b>従業員</b>の数を増やす予定だ。", "会社[かいしゃ]は<b> 従業員[じゅうぎょういん]</b>の 数[かず]を 増[ふ]やす 予定[よてい]だ。", "かいしゃ は <b>じゅうぎょういん</b> の かず を ふやす よてい だ", "The company plans to increase the number of employees.", "2600a353451a0fa5c817323219d5d250.mp3", "従業員", "従業員[じゅうぎょういん]", "じゅうぎょういん", "'employee, worker'", "Noun", "174aa9d4da73311e1bd93850ac30fda8.mp3" },
                    { 3482, "JLPT1", "従業員は明日から<b>ストライキ</b>です。", "従業員[じゅうぎょういん]は 明日[あす]から<b>ストライキ</b>です。", "じゅうぎょういん は あす から <b>すとらいき</b> です", "Employees will go on strike from tomorrow.", "72be340f9c8c263042b88a437178229b.mp3", "ストライキ", "ストライキ", "ストライキ", "strike", "Noun", "5050502caaa046278b2b3083cf7b055f.mp3" },
                    { 3483, "JLPT1", "私は<b>良心</b>に従って行動します。", "私[わたし]は<b> 良心[りょうしん]</b>に 従[したが]って 行動[こうどう]します。", "わたし は <b>りょうしん</b> に したがって こうどう します", "I behave according to my conscience.", "4065713e6260ff8e1f07ec5db13ed7bf.mp3", "良心", "良心[りょうしん]", "りょうしん", "conscience", "Noun", "4df244e91c019157a8169e982b09e544.mp3" },
                    { 3484, "JLPT2", "国民は<b>法</b>に従わなければならないよ。", "国民[こくみん]は<b> 法[ほう]</b>に 従[したが]わなければならないよ。", "こくみん は <b>ほう</b> に したがわなければ ならない よ", "Citizens must observe the law.", "6fcf00024d55cb1205a620ef126aace9.mp3", "法", "法[ほう]", "ほう", "'law, rule'", "Noun", "bc93a23be2fd2c8be3491da787daa97f.mp3" },
                    { 3485, "JLPT2", "新しい社員を<b>雇いました</b>。", "新[あたら]しい 社員[しゃいん]を<b> 雇[やと]いました</b>。", "あたらしい しゃいん を <b>やといました</b>", "We employed a new staff member.", "5d904386b520d92560be43bd45256264.mp3", "雇う", "雇[やと]う", "やとう", "'employ, hire'", "Verb", "2f631d4da528f12357e00f3a2d4669c8.mp3" },
