                    { 3487, "JLPT0", "あなたの成績が下がったのは<b>当たり前</b>です。", "あなたの 成績[せいせき]が 下[さ]がったのは<b> 当[あ]たり 前[まえ]</b>です。", "あなた の せいせき が さがった の は <b>あたりまえ</b> です", "No wonder your grades dropped.", "eca7e16ba770d7e3547ba313e6622245.mp3", "当たり前", "当[あ]たり 前[まえ]", "あたりまえ", "'of course, obvious'", "Adjectival Noun", "f4cba57da429ee4e51fb58d66e66508c.mp3" },
                    { 3488, "JLPT2", "彼女の成績は上の<b>下</b>です。", "彼女[かのじょ]の 成績[せいせき]は 上[じょう]の<b> 下[げ]</b>です。", "かのじょ の せいせき は じょう の <b>げ</b> です", "Her grades are ranked at the bottom of the top group.", "aaf2d0ecf0bc327da2dda390f01337bc.mp3", "下", "下[げ]", "げ", "'low class, inferiority, below'", "Noun", "496f8f3a09113c639d43ca03fb6d992e.mp3" },
                    { 3489, "JLPT2", "彼は<b>トップ</b>の成績で合格しました。", "彼[かれ]は<b>トップ</b>の 成績[せいせき]で 合格[ごうかく]しました。", "かれ は <b>とっぷ</b> の せいせき で ごうかく しました", "He passed with the best score.", "6057d726496c461ea8e5990a992d9d4b.mp3", "トップ", "トップ", "トップ", "top", "Noun", "9018f19c809fba3b040936136693aa35.mp3" },
                    { 3490, "JLPT2", "彼はトップに<b>次ぐ</b>好成績でした。", "彼[かれ]はトップに<b> 次[つ]ぐ</b> 好成績[こうせいせき]でした。", "かれ は とっぷ に <b>つぐ</b> こうせいせき でした", "His excellent results were next to the top.", "7f40258ba135949064bb1f851de06922.mp3", "次ぐ", "次[つ]ぐ", "つぐ", "'rank next to, come next'", "Verb", "f08fa8610409cb5a76c21f3f9d22b110.mp3" },
                    { 3491, "JLPT2", "今年の応募作品は<b>水準</b>が高かったね。", "今年[ことし]の 応募作品[おうぼ さくひん]は<b> 水準[すいじゅん]</b>が 高[たか]かったね。", "ことし の おうぼ さくひん は <b>すいじゅん</b> が たかかった ね", "The standard of entries this year was high.", "7df55339d8dd93fa2a69e109b41b5b64.mp3", "水準", "水準[すいじゅん]", "すいじゅん", "'level, standard'", "Noun", "845d98533c12eba150ca698fbfe9a6dd.mp3" },
                    { 3492, "JLPT1", "求人に多数の<b>応募</b>があった。", "求人[きゅうじん]に 多数[たすう]の<b> 応募[おうぼ]</b>があった。", "きゅうじん に たすう の <b>おうぼ</b> が あった", "There were a lot of applications for the job opening.", "2f920f25b38831ba6b28e86cf7ebd01b.mp3", "応募", "応募[おうぼ]", "おうぼ", "application", "Verbal Noun", "0dca9a1901a123e7893491fcef8e33d2.mp3" },
                    { 3493, "JLPT0", "その仕事に<b>多数</b>の応募があったよ。", "その 仕事[しごと]に<b> 多数[たすう]</b>の 応募[おうぼ]があったよ。", "その しごと に <b>たすう</b> の おうぼ が あった よ", "There were a lot of applications for the job.", "ed39aa00331de8fc3d79b8f4ac2a7fa1.mp3", "多数", "多数[たすう]", "たすう", "'large number, multitude'", "Noun", "d032e011ea5b5dc6514d9fa243baab13.mp3" },
                    { 3494, "JLPT2", "応募作品の<b>大小</b>は問いません。", "応募作品[おうぼ さくひん]の<b> 大小[だいしょう]</b>は 問[と]いません。", "おうぼ さくひん の <b>だいしょう</b> は といません", "Submitted works of all sizes accepted.", "998ef4212a07240b6ad8be3fd9902841.mp3", "大小", "大小[だいしょう]", "だいしょう", "size", "Noun", "cd163cad78a3570424e61e0e670b6188.mp3" },
                    { 3495, "JLPT1", "資格を<b>有する</b>人のみ応募できます。", "資格[しかく]を<b> 有[ゆう]する</b> 人[ひと]のみ 応募[おうぼ]できます。", "しかく を <b>ゆうする</b> ひと のみ おうぼ できます", "Only qualified individuals may apply.", "ffff92bbb7441d6ca3d7a6a2bb279490.mp3", "有する", "有[ゆう]する", "ゆうする", "'have, possess'", "Verb", "a61a9e0c6aae8ddabc67def1c70c8ddf.mp3" },
                    { 3496, "JLPT2", "勉強に<b>集中</b>しなさい。", "勉強[べんきょう]に<b> 集中[しゅうちゅう]</b>しなさい。", "べんきょう に <b>しゅうちゅう</b> しなさい", "Concentrate on studying.", "6272fc7090ef614a3f7f6c21bfc90c04.mp3", "集中", "集中[しゅうちゅう]", "しゅうちゅう", "'concentration, convergence'", "Verbal Noun", "5d540b935ca280b38d4a65f3453aa0b3.mp3" },
                    { 3497, "JLPT2", "7時5分に駅で<b>集合</b>しましょう。", "7時5分[しち じ ご ふん]に 駅[えき]で<b> 集合[しゅうごう]</b>しましょう。", "しち じ ご ふん に えき で <b>しゅうごう</b> しましょう", "Lets meet at the station at 7:05", "011df305129645fef38a4618169cc64d.mp3", "集合", "集合[しゅうごう]", "しゅうごう", "'gathering, assembly'", "Verbal Noun", "e03ef736e661d637e111e06e8df90320.mp3" },
                    { 3498, "JLPT2", "今日は<b>組合</b>の集まりがあるわ。", "今日[きょう]は<b> 組合[くみあい]</b>の 集[あつ]まりがあるわ。", "きょう は <b>くみあい</b> の あつまり が ある わ", "There is a union meeting today.", "1fd7ea7079abfac3c8d76ce4f854877a.mp3", "組合", "組合[くみあい]", "くみあい", "'union, guild'", "Noun", "0a88e11a3f9f998a7a75886cdc60e29a.mp3" },
                    { 3499, "JLPT2", "<b>高度</b>な技術を持つ人材を集めました。", "<b> 高度[こうど]</b>な 技術[ぎじゅつ]を 持[も]つ 人材[じんざい]を 集[あつ]めました。", "<b>こうど</b> な ぎじゅつ を もつ じんざい を あつめました", "Weve attracted highly-skilled personnel.", "4b89efc41a678006fbdd100d7a8fea3a.mp3", "高度", "高度[こうど]", "こうど", "high degree", "Adjectival Noun", "8adbf709cc75318c17f63ff71dff34cf.mp3" },
                    { 3500, "JLPT0", "そのマラソン大会にはたくさんの<b>国々</b>から選手が集まったよ。", "そのマラソン 大会[たいかい]にはたくさんの<b> 国々[くにぐに]</b>から 選手[せんしゅ]が 集[あつ]まったよ。", "その まらそん たいかい に は たくさん の <b>くにぐに</b> から せんしゅ が あつまった よ", "A lot of athletes from many countries gathered for the marathon.", "fd2803a38200a910e6dbb60a84471633.mp3", "国々", "国々[くにぐに]", "くにぐに", "'nations, countries'", "Noun", "cb1620500b84da60a4cb13a69d59602c.mp3" },
                    { 3501, "JLPT2", "雨で<b>集まり</b>が悪いですね。", "雨[あめ]で<b> 集[あつ]まり</b>が 悪[わる]いですね。", "あめ で <b>あつまり</b> が わるい です ね", "Not many people are showing up because of the rain.", "fea9d3f5c1fb95199bc8acc08d494aca.mp3", "集まり", "集[あつ]まり", "あつまり", "'gathering, assembly'", "Noun", "bb051f32adb3114b5962b1e715032e95.mp3" },
                    { 3502, "JLPT2", "その都市には<b>様々</b>な人種が集まっているわ。", "その 都市[とし]には<b> 様々[さまざま]</b>な 人種[じんしゅ]が 集[あつ]まっているわ。", "その とし に は <b>さまざま</b> な じんしゅ が あつまって いる わ", "There are a lot of different ethnic groups in this city.", "8faac9933149eb73dacc5180dd38595d.mp3", "様々", "様々[さまざま]", "さまざま", "'various, diverse'", "Adjective", "cd77737c812d5643b9f900fcbfef76a3.mp3" },
                    { 3503, "JLPT2", "私の会社で社員を<b>募集</b>しています。", "私[わたし]の 会社[かいしゃ]で 社員[しゃいん]を<b> 募集[ぼしゅう]</b>しています。", "わたし の かいしゃ で しゃいん を <b>ぼしゅう</b> して います", "My company is recruiting new staff.", "09dfae0384d224d1cc58d8c74c182133.mp3", "募集", "募集[ぼしゅう]", "ぼしゅう", "'recruitment, collection'", "Verbal Noun", "98a22f1e404cbaa528b6f84807797c9f.mp3" },
                    { 3504, "JLPT1", "集合時間を30分<b>早めました</b>。", "集合時間[しゅうごうじかん]を30 分[ぷん]<b> 早[はや]めました</b>。", "しゅうごうじかん を 30 ぷん <b>はやめました</b>", "I pushed forward the meeting time by 30 minutes.", "8a34d8ec687f45ab1a9a3b00591ccef5.mp3", "早める", "早[はや]める", "はやめる", "'move forward (in time), expedite'", "Verb", "b190fb321d0c222354cf55d3fcf4d010.mp3" },
                    { 3505, "JLPT2", "今から<b>答案</b>を集めます。", "今[いま]から<b> 答案[とうあん]</b>を 集[あつ]めます。", "いま から <b>とうあん</b> を あつめます", "Ill collect the answer sheets now.", "8e32445565b162004321e281aac0dea3.mp3", "答案", "答案[とうあん]", "とうあん", "'examination paper, answer'", "Noun", "83d156f8fffff231a78f5e94061416c9.mp3" },
                    { 3506, "JLPT1", "コストがこんなに高くては<b>採算</b>が取れません。", "コストがこんなに 高[たか]くては<b> 採算[さいさん]</b>が 取[と]れません。", "こすと が こんなに たかくて は <b>さいさん</b> が とれません", "'When the costs are so high, profit cant be made.'", "36b34bfbc0cd55ee3c57c5c186e82b82.mp3", "採算", "採算[さいさん]", "さいさん", "profit", "Noun", "871aa9641563035185a124ecbdffd85a.mp3" },
                    { 3507, "JLPT2", "先生は試験の<b>採点</b>が終わったようね。", "先生[せんせい]は 試験[しけん]の<b> 採点[さいてん]</b>が 終[お]わったようね。", "せんせい は しけん の <b>さいてん</b> が おわった よう ね", "It seems that the teacher has finished marking the examination.", "345f9597cf7cbdb9638c069633df0bfe.mp3", "採点", "採点[さいてん]", "さいてん", "'marking, grading'", "Verbal Noun", "9fc9e8790454bcb16b909bef9f76c1c0.mp3" },
                    { 3508, "JLPT2", "この山ではきのこが<b>採れます</b>よ", "この 山[やま]ではきのこが<b> 採[と]れます</b>よ", "この やま で は きのこ が <b>とれます</b> よ", "You can collect mushrooms on this mountain.", "0158be40d96de45fd09ae96c622c2ef0.mp3", "採る", "採[と]る", "とる", "'gather, pick'", "Verb", "796bf9c23e01ae252da0955a9e116d5f.mp3" },
                    { 3509, "JLPT2", "彼の会社は電力を<b>供給</b>しています。", "彼[かれ]の 会社[かいしゃ]は 電力[でんりょく]を<b> 供給[きょうきゅう]</b>しています。", "かれ の かいしゃ は でんりょく を <b>きょうきゅう</b> して います", "His company supplies electricity.", "6be4c379d68faa81e2efc5e2e1795613.mp3", "供給", "供給[きょうきゅう]", "きょうきゅう", "'supply, provision'", "Verbal Noun", "e8ab9ab0a8706e7566c03ce90b2eb8b6.mp3" },
                    { 3510, "JLPT2", "<b>月給</b>は毎月25日に支給されます。", "<b> 月給[げっきゅう]</b>は 毎月25日[まいつき にじゅうごにち]に 支給[しきゅう]されます。", "<b>げっきゅう</b> は まいつき にじゅうごにち に しきゅう されます", "The salary is paid on the 25th of every month.", "f9ec1f254a8b683e6dff79b7130d2036.mp3", "月給", "月給[げっきゅう]", "げっきゅう", "monthly salary", "Noun", "66b9bfd3b20125d5a3223cd5c787562b.mp3" },
                    { 3511, "JLPT0", "この仕事は<b>時給</b>1000円です。", "この 仕事[しごと]は<b> 時給[じきゅう]</b> 1000円[せんえん]です。", "この しごと は <b>じきゅう</b> せんえん です", "This work pays 1000 yen per hour.", "d20f998488e82f222da6a2ac8350455f.mp3", "時給", "時給[じきゅう]", "じきゅう", "hourly wage", "Noun", "47e61b88e3d061fdc65960b13f5b9a5b.mp3" },
                    { 3512, "JLPT2", "大学卒業は<b>一昨年</b>です。", "大学卒業[だいがく そつぎょう]は<b> 一昨年[いっさくねん]</b>です。", "だいがく そつぎょう は <b>いっさくねん</b> です", "I graduated from university two years ago.", "c12ea32e63273b22b0c10191effbdd9d.mp3", "一昨年", "一昨年[いっさくねん]", "いっさくねん", "the year before last", "Noun", "1f2cb826cb2d9205aedcce36a0612d7f.mp3" },
                    { 3513, "JLPT1", "3月に大学を卒業の<b>見込み</b>です。", "3 月[がつ]に 大学[だいがく]を 卒業[そつぎょう]の<b> 見込[みこ]み</b>です。", "3 がつ に だいがく を そつぎょう の <b>みこみ</b> です", "I expect to graduate from university in March.", "cd665bcfe0c4b7c3c86b6b6a88809a32.mp3", "見込み", "見込[みこ]み", "みこみ", "'hope, prospect'", "Noun", "c28b06da7d27db0607f69b0020104bb7.mp3" },
                    { 3514, "JLPT2", "<b>論文</b>を仕上げないと卒業できませんよ。", "<b> 論文[ろんぶん]</b>を 仕上[しあ]げないと 卒業[そつぎょう]できませんよ。", "<b>ろんぶん</b> を しあげない と そつぎょう できません よ", "You cant graduate if you dont finish your thesis.", "d860d68c65efd125289eab4a0fbd59d8.mp3", "論文", "論文[ろんぶん]", "ろんぶん", "'thesis, paper'", "Noun", "470c4d667500d17c93d88e336875683c.mp3" },
                    { 3515, "JLPT1", "妹は<b>短大</b>を卒業しました。", "妹[いもうと]は<b> 短大[たんだい]</b>を 卒業[そつぎょう]しました。", "いもうと は <b>たんだい</b> を そつぎょう しました", "My little sister graduated from junior college.", "bdae38e2296904acb13c97593ceedead.mp3", "短大", "短大[たんだい]", "たんだい", "junior college", "Noun", "1c00401e9b028fac9338ad67a4fbdf70.mp3" },
                    { 3516, "JLPT0", "卒業式に<b>花束</b>をもらいました。", "卒業式[そつぎょうしき]に<b> 花束[はなたば]</b>をもらいました。", "そつぎょうしき に <b>はなたば</b> を もらいました", "I got a bouquet of flowers at my graduation ceremony.", "9c5dc6db31b0ac8f7561c8d75817066e.mp3", "花束", "花束[はなたば]", "はなたば", "bunch of flowers", "Noun", "eb776b5387ae866ddcf8f51bd73426f5.mp3" },
                    { 3517, "JLPT2", "彼は新首相に<b>就任</b>しましたね。", "彼[かれ]は 新首相[しんしゅしょう]に<b> 就任[しゅうにん]</b>しましたね。", "かれ は しんしゅしょう に <b>しゅうにん</b> しました ね", "He assumed his post as the new Prime Minister.", "cc4b0aa6170ba67c0f9839a46c1b1dd3.mp3", "就任", "就任[しゅうにん]", "しゅうにん", "'inauguration, appointment'", "Verbal Noun", "f61b89cbbd6fc9348f23df7fe76d8440.mp3" },
                    { 3518, "JLPT2", "今年から新しい仕事に<b>就きます</b>。", "今年[ことし]から 新[あたら]しい 仕事[しごと]に<b> 就[つ]きます</b>。", "ことし から あたらしい しごと に <b>つきます</b>", "Ill start a new job this year.", "5f7646b3938c2e07b5b07c7b94085253.mp3", "就く", "就[つ]く", "つく", "'set about a task, enter upon'", "Verb", "0d7071d9f74de38f6790646dd21d7d25.mp3" },
                    { 3519, "JLPT1", "ここは<b>職員</b>専用の出入り口です。", "ここは<b> 職員[しょくいん]</b> 専用[せんよう]の 出入[でい]り 口[ぐち]です。", "ここ は <b>しょくいん</b> せんよう の でいりぐち です", "This is an entrance for staff only.", "848339e224b08e8bd8d3629a18381e8a.mp3", "職員", "職員[しょくいん]", "しょくいん", "'staff, employee'", "Noun", "3a0ddc399767738cc361081ec56cefb6.mp3" },
                    { 3520, "JLPT2", "あなたの<b>職業</b>を教えてください。", "あなたの<b> 職業[しょくぎょう]</b>を 教[おし]えてください。", "あなた の <b>しょくぎょう</b> を おしえて ください", "Please tell me your occupation.", "45fe1ea039154b133c1a15dca6db8c3f.mp3", "職業", "職業[しょくぎょう]", "しょくぎょう", "'occupation, vocation'", "Noun", "88ca149a6a7efb79ce6c0adf6de4fe68.mp3" },
                    { 3521, "JLPT2", "私は<b>私鉄</b>の職員です。", "私[わたし]は<b> 私鉄[してつ]</b>の 職員[しょくいん]です。", "わたし は <b>してつ</b> の しょくいん です", "Im an employee of a private railway company.", "f5320efcd9f18e67ea2f58f85bcc51de.mp3", "私鉄", "私鉄[してつ]", "してつ", "private railway", "Noun", "43e268849fe0597ea563ba4bb36b908a.mp3" },
                    { 3522, "JLPT2", "彼は<b>名</b>の通った会社に就職しました。", "彼[かれ]は<b> 名[な]</b>の 通[とお]った 会社[かいしゃ]に 就職[しゅうしょく]しました。", "かれ は <b>な</b> の とおった かいしゃ に しゅうしょく しました", "He found employment in a well-known company.", "09a3731f98b2807a0325e52ed73ec791.mp3", "名", "名[な]", "な", "'name, reputation'", "Noun", "586209fdbd87dca4a6fafbedb294e618.mp3" },
                    { 3523, "JLPT0", "彼の職場は<b>都内</b>にあります。", "彼[かれ]の 職場[しょくば]は<b> 都内[とない]</b>にあります。", "かれ の しょくば は <b>とない</b> に あります", "His office is in the Tokyo metropolitan area.", "476aeb04c30e2c5bc232eeb0378b9a67.mp3", "都内", "都内[とない]", "とない", "in the metropolitan area of Tokyo", "Noun", "3249c6cb9a5c2a0e358e115ea806aedf.mp3" },
                    { 3524, "JLPT2", "資格があると就職に<b>有利</b>です。", "資格[しかく]があると 就職[しゅうしょく]に<b> 有利[ゆうり]</b>です。", "しかく が ある と しゅうしょく に <b>ゆうり</b> です", "Its advantageous to have qualifications when looking for work.", "c42bd0b1eaf26d73381d78001f221776.mp3", "有利", "有利[ゆうり]", "ゆうり", "'advantageous, profitable'", "Adjectival Noun", "9ffa32c172ca714a956f65f4d14ca47a.mp3" },
                    { 3525, "JLPT2", "彼女は<b>都</b>の職員です。", "彼女[かのじょ]は<b> 都[と]</b>の 職員[しょくいん]です。", "かのじょ は <b>と</b> の しょくいん です", "Shes an official of the metropolitan government.", "0754b056bbc42948090e318592a56f6c.mp3", "都", "都[と]", "と", "metropolis of Tokyo", "Noun", "73d8d56a780b1f2f45f76fc428848413.mp3" },
                    { 3526, "JLPT0", "職場での男女<b>不平等</b>はよく見られるね。", "職場[しょくば]での 男女[だんじょ]<b> 不平等[ふびょうどう]</b>はよく 見[み]られるね。", "しょくば で の だんじょ <b>ふびょうどう</b> は よく みられる ね", "You can often find gender inequality in the workplace.", "e5b874c3446088e5309dbbf7afc88d15.mp3", "不平等", "不平等[ふびょうどう]", "ふびょうどう", "'unequal, unfair'", "Adjectival Noun", "7f236dddab399e45444eff53e426364e.mp3" },
                    { 3527, "JLPT1", "私は今月一杯で<b>退職</b>します。", "私[わたし]は 今月一杯[こんげつ いっぱい]で<b> 退職[たいしょく]</b>します。", "わたし は こんげつ いっぱい で <b>たいしょく</b> します", "I retire at the end of this month.", "098a83e4b7a19e9cc1b0336fcc2ec2d5.mp3", "退職", "退職[たいしょく]", "たいしょく", "'retirement, resignation'", "Verbal Noun", "c5c15c9260ffddb614aa24afaa880c59.mp3" },
                    { 3528, "JLPT1", "弟は高校を<b>退学</b>しました。", "弟[おとうと]は 高校[こうこう]を<b> 退学[たいがく]</b>しました。", "おとうと は こうこう を <b>たいがく</b> しました", "My little brother withdrew from high school.", "0965db0726de4691160b5530db4cef46.mp3", "退学", "退学[たいがく]", "たいがく", "withdrawal from school", "Verbal Noun", "483a68a98bd9454bf8f85c47facffc0b.mp3" },
                    { 3529, "JLPT0", "具合が悪かったので仕事を<b>早退</b>しました。", "具合[ぐあい]が 悪[わる]かったので 仕事[しごと]を<b> 早退[そうたい]</b>しました。", "ぐあい が わるかった の で しごと を <b>そうたい</b> しました", "I left work earlier than usual because I was unwell.", "0fa2fb88dcc14214adbb8fed5e7ed8dc.mp3", "早退", "早退[そうたい]", "そうたい", "early departure", "Verbal Noun", "69fee2809afd5485ca3acd6cbfe97453.mp3" },
                    { 3530, "JLPT1", "彼には<b>理屈</b>が通じない。", "彼[かれ]には<b> 理屈[りくつ]</b>が 通[つう]じない。", "かれ に は <b>りくつ</b> が つうじない", "He doesnt understand logics.", "c30290f4dd480f9279f448d45d47a591.mp3", "理屈", "理屈[りくつ]", "りくつ", "'reason, logic'", "Noun", "27d896d9cf68c3a5d257f280dcc4ab6b.mp3" },
                    { 3531, "JLPT2", "校長の<b>退屈</b>な話が続いたんだよ。", "校長[こうちょう]の<b> 退屈[たいくつ]</b>な 話[はなし]が 続[つづ]いたんだよ。", "こうちょう の <b>たいくつ</b> な はなし が つづいた ん だ よ", "The principals boring talk carried on.", "788520562060ec173874703fc30fbb05.mp3", "退屈", "退屈[たいくつ]", "たいくつ", "'boring, tedious'", "Verbal Noun", "8223431ada008ab473fc3cf97225a73a.mp3" },
                    { 3532, "JLPT2", "あの会社との契約が<b>成立</b>しました。", "あの 会社[かいしゃ]との 契約[けいやく]が<b> 成立[せいりつ]</b>しました。", "あの かいしゃ と の けいやく が <b>せいりつ</b> しました", "We concluded a contract with that company.", "859ff351e1cbdf35a7ddfc22a0b1016c.mp3", "成立", "成立[せいりつ]", "せいりつ", "formation", "Verbal Noun", "cb5d5d641f3d6453ecac6e8df1883a03.mp3" },
                    { 3533, "JLPT0", "彼はその会社と<b>雇用</b>契約を結んだの。", "彼[かれ]はその 会社[かいしゃ]と<b> 雇用[こよう]</b> 契約[けいやく]を 結[むす]んだの。", "かれ は その かいしゃ と <b>こよう</b> けいやく を むすんだ の", "He signed a contract of employment with the company.", "50a0851b0b9bff457db3d7eae3d92667.mp3", "雇用", "雇用[こよう]", "こよう", "employment", "Verbal Noun", "7ccd45c85f9af24f91f332aba6a92acd.mp3" },
                    { 3534, "JLPT2", "社長<b>自ら</b>がその会社と交渉したよ。", "社長[しゃちょう]<b> 自[みずか]ら</b>がその 会社[かいしゃ]と 交渉[こうしょう]したよ。", "しゃちょう <b>みずから</b> が その かいしゃ と こうしょう した よ", "The president himself negotiated with the company.", "6c33b743461b7e337073332968ad7798.mp3", "自ら", "自[みずか]ら", "みずから", "oneself", "Adverb", "a4b4c62829ef7b2e1d23dafaf751debc.mp3" },
                    { 3535, "JLPT1", "交渉が成立するという<b>前提</b>で話を進めます。", "交渉[こうしょう]が 成立[せいりつ]するという<b> 前提[ぜんてい]</b>で 話[はなし]を 進[すす]めます。", "こうしょう が せいりつ する と いう <b>ぜんてい</b> で はなし を すすめます", "Were proceeding with talks under the assumption well complete the deal.", "954f919305e8a8a90e43342763d3a0a4.mp3", "前提", "前提[ぜんてい]", "ぜんてい", "'assumption, premise'", "Noun", "d06a50e494579af2384209668e79634e.mp3" },
                    { 3536, "JLPT1", "2国間で<b>条約</b>が結ばれました。", "2国間[にこくかん]で<b> 条約[じょうやく]</b>が 結[むす]ばれました。", "にこくかん で <b>じょうやく</b> が むすばれました", "A treaty was concluded between the two countries.", "640fa6fd77fa2bf1ad9066f41edadacf.mp3", "条約", "条約[じょうやく]", "じょうやく", "treaty", "Noun", "6da40e01398ec3a13a2a63eeb8228933.mp3" },
                    { 3537, "JLPT0", "その事件は<b>次第に</b>忘れられていったのさ。", "その 事件[じけん]は<b> 次第[しだい]に</b> 忘[わす]れられていったのさ。", "その じけん は <b>しだいに</b> わすれられて いった の さ", "The incident was gradually forgotten.", "718fdbd3d23b321ce0bdfa627c9f6b51.mp3", "次第に", "次第[しだい]に", "しだいに", "'gradually, by degrees'", "Adverb", "1d510738a538d114ffe504ce3fd056c9.mp3" },
                    { 3538, "JLPT1", "最近、事件の<b>真相</b>が明らかになったよ。", "最近[さいきん]、 事件[じけん]の<b> 真相[しんそう]</b>が 明[あき]らかになったよ。", "さいきん じけん の <b>しんそう</b> が あきらか に なった よ", "Recently the truth of the case has been revealed.", "a2892592f2ab79d0ec1a679d1aec78b7.mp3", "真相", "真相[しんそう]", "しんそう", "the truth", "Noun", "2d3c96d569c63bc2bda650cb0d8e6c25.mp3" },
