                    { 3894, "JLPT0", "彼は<b>幅広い</b>知識を持っています。", "彼[かれ]は<b> 幅広[はばひろ]い</b> 知識[ちしき]を 持[も]っています。", "かれ は <b>はばひろい</b> ちしき を もって います", "His knowledge is profound.", "c149e4603b2e8d3d4e076eb7623eae50.mp3", "幅広い", "幅広[はばひろ]い", "はばひろい", "'wide, broad'", "Adjective", "7844d07dbc7b5c892bb02405300ad915.mp3" },
