                    { 4079, "JLPT2", "地図内の小さい建物は<b>省略</b>してあります。", "地図内[ちずない]の 小[ちい]さい 建物[たてもの]は<b> 省略[しょうりゃく]</b>してあります。", "ちずない の ちいさい たてもの は <b>しょうりゃく</b> して あります", "Small buildings have been omitted from the map.", "82c900d64ec7ef40276de91bf5b519a8.mp3", "省略", "省略[しょうりゃく]", "しょうりゃく", "'omission, abbreviation'", "Verbal Noun", "b046d2e26b8749a51898b28a838e27f8.mp3" },
                    { 4080, "JLPT2", "国際連合を<b>略して</b>国連といいます。", "国際連合[こくさいれんごう]を<b> 略[りゃく]して</b> 国連[こくれん]といいます。", "こくさいれんごう を <b>りゃく して</b> こくれん と いいます", "The UN is short for the United Nations.", "f3995f25f18389b7a29bfec5be0cc12e.mp3", "略す", "略[りゃく]す", "りゃくす", "'abbreviate, omit'", "Verb", "bf57a5b34a5e00711485e445cad7b144.mp3" },
                    { 4081, "JLPT0", "「IT」は何の<b>略</b>か知っていますか。", "「 IT」[あいてぃー]は 何[なん]の<b> 略[りゃく]</b>か 知[し]っていますか。", "あいてぃー は なん の <b>りゃく</b> か しって います か", "Do you know what IT stands for?", "a8f1571cd268facdb2dc9c4be1ea3d2f.mp3", "略", "略[りゃく]", "りゃく", "abbreviation", "Noun", "fd37c656a64e08078578946b8e0993a9.mp3" },
                    { 4082, "JLPT1", "インターネットは情報の<b>概念</b>を変えたよね。", "インターネットは 情報[じょうほう]の<b> 概念[がいねん]</b>を 変[か]えたよね。", "いんたーねっと は じょうほう の <b>がいねん</b> を かえた よ ね", "The Internet changed the concept of information.", "df96d6e9e27418f24502fc9f093cbf09.mp3", "概念", "概念[がいねん]", "がいねん", "'general idea, concept'", "Noun", "47ab5a915d7aa4138725f54da522f83e.mp3" },
                    { 4083, "JLPT2", "卒業の<b>記念</b>にみんなで旅行したよ。", "卒業[そつぎょう]の<b> 記念[きねん]</b>にみんなで 旅行[りょこう]したよ。", "そつぎょう の <b>きねん</b> に みんな で りょこう した よ", "We all went on a trip to celebrate our graduation.", "d5f7b4382ef9fbad8501bdc2cd850231.mp3", "記念", "記念[きねん]", "きねん", "'commemoration, memory'", "Verbal Noun", "cb2c9b45bb74db4364daee3b80b824ea.mp3" },
                    { 4084, "JLPT0", "自分の<b>信念</b>に従いたいと思います。", "自分[じぶん]の<b> 信念[しんねん]</b>に 従[したが]いたいと 思[おも]います。", "じぶん の <b>しんねん</b> に したがいたい と おもいます", "I think I want to follow my own faith.", "8fbb84c8e07862682c0fd7e941277620.mp3", "信念", "信念[しんねん]", "しんねん", "'belief, conviction'", "Noun", "e3f5b1fe68f92fb051a3b40b020dca1a.mp3" },
                    { 4085, "JLPT0", "残念ながら試験は<b>不合格</b>でした。", "残念[ざんねん]ながら 試験[しけん]は<b> 不合格[ふごうかく]</b>でした。", "ざんねん ながら しけん は <b>ふごうかく</b> でした", "'To our regret, he failed the examination.'", "abe7d7b94b99a97a771744033fe51733.mp3", "不合格", "不合格[ふごうかく]", "ふごうかく", "'failure, disqualification'", "Noun", "115ba30f8b1646900fdf0fae2e848053.mp3" },
                    { 4086, "JLPT1", "代金には<b>規定</b>の手数料が含まれます。", "代金[だいきん]には<b> 規定[きてい]</b>の 手数料[てすうりょう]が 含[ふく]まれます。", "だいきん に は <b>きてい</b> の てすうりょう が ふくまれます", "Our price includes a set handling fee.", "7fedc9a39ecf2beee7e833839d1892a5.mp3", "規定", "規定[きてい]", "きてい", "'regulation, provision'", "Verbal Noun", "20cbb58e7d9893f9486098a4540f6eb2.mp3" },
                    { 4087, "JLPT2", "この製品は有害な化学<b>物質</b>を含んでいるわよ。", "この 製品[せいひん]は 有害[ゆうがい]な 化学[かがく]<b> 物質[ぶっしつ]</b>を 含[ふく]んでいるわよ。", "この せいひん は ゆうがい な かがく<b>ぶっしつ</b> を ふくんで いる わ よ", "This product contains a harmful chemical.", "3bb57da50be27916eed4ba4f6de52cd6.mp3", "物質", "物質[ぶっしつ]", "ぶっしつ", "'matter, substance'", "Noun", "0642eb4f9ba1555f068493b169373dc6.mp3" },
                    { 4088, "JLPT2", "私を<b>含めて</b>10人が参加しました。", "私[わたし]を<b> 含[ふく]めて</b>10 人[にん]が 参加[さんか]しました。", "わたし を <b>ふくめて</b> 10 にん が さんか しました", "'Ten people participated, myself included.'", "24fa1f4b7f2a69c04c6f25bce893269c.mp3", "含める", "含[ふく]める", "ふくめる", "include", "Verb", "b7e4e297fde84e72837811ac7ca67d78.mp3" },
                    { 4089, "JLPT2", "その食品は有害物質を<b>含んでいる</b>ぞ。", "その 食品[しょくひん]は 有害物質[ゆうがい ぶっしつ]を<b> 含[ふく]んでいる</b>ぞ。", "その しょくひん は ゆうがい ぶっしつ を <b>ふくんで いる</b> ぞ", "The food contains a poisonous substance.", "4c81df7dde6939f954393eef642eea12.mp3", "含む", "含[ふく]む", "ふくむ", "'contain, include'", "Verb", "9a3cb58b8f35338d99f96f8f39d31a6e.mp3" },
                    { 4090, "JLPT2", "進み具合は全て<b>順調</b>です。", "進[すす]み 具合[ぐあい]は 全[すべ]て<b> 順調[じゅんちょう]</b>です。", "すすみ ぐあい は すべて <b>じゅんちょう</b> です", "It is all progressing well.", "c62062cda516e4b2b9cce6560448027f.mp3", "順調", "順調[じゅんちょう]", "じゅんちょう", "'favorable condition, smooth progress'", "Adjectival Noun", "1371be9769d3b571b01e9fea1f4dd76f.mp3" },
                    { 4091, "JLPT1", "手術後の<b>経過</b>は順調です。", "手術後[しゅじゅつ ご]の<b> 経過[けいか]</b>は 順調[じゅんちょう]です。", "しゅじゅつ ご の <b>けいか</b> は じゅんちょう です", "Progress after the operation is going well.", "cb06f87dc219f6cc90a218bc00f6f7ce.mp3", "経過", "経過[けいか]", "けいか", "'progression, lapse'", "Verbal Noun", "6e99050f3e23e676a066a4cd8244b45b.mp3" },
                    { 4092, "JLPT2", "あいうえお<b>順</b>に並べて下さい。", "あいうえお<b> 順[じゅん]</b>に 並[なら]べて 下[くだ]さい。", "あいうえお <b>じゅん</b> に ならべて ください", "Please line up in order of the Japanese syllabary.", "97e0adb0340ae3747539cb9b046e8fe5.mp3", "順", "順[じゅん]", "じゅん", "'order, sequence'", "Noun", "6084697d1b542e6f22bdde37187c0396.mp3" },
                    { 4093, "JLPT2", "これを<b>順番</b>通りに並べ替えて下さい。", "これを<b> 順番[じゅんばん]</b> 通[どお]りに 並[なら]べ 替[か]えて 下[くだ]さい。", "これ を <b>じゅんばん</b> どおり に ならべ かえて ください", "Please rearrange these in order.", "2bb778a9cda932e0512864ba36c7c367.mp3", "順番", "順番[じゅんばん]", "じゅんばん", "'order, turn'", "Noun", "3ca2aa7a16dcd63da885765c6b6bc3b8.mp3" },
                    { 4094, "JLPT0", "今年は去年よりも<b>順位</b>が上がりました。", "今年[ことし]は 去年[きょねん]よりも<b> 順位[じゅんい]</b>が 上[あ]がりました。", "ことし は きょねん より も <b>じゅんい</b> が あがりました", "Our rank went up this year more than it did last year.", "777baeb36d0e1a98e4933e0e7d34163e.mp3", "順位", "順位[じゅんい]", "じゅんい", "'order, rank'", "Noun", "ae3858bced4f96fc7a939b6d5ce9b4c6.mp3" },
                    { 4095, "JLPT2", "名前は<b>五十音</b>順に並んでいます。", "名前[なまえ]は<b> 五十音[ごじゅうおん]</b> 順[じゅん]に 並[なら]んでいます。", "なまえ は <b>ごじゅうおん</b>じゅん に ならんで います", "The names are arranged in the order of the Japanese syllabary.", "88b18873294b29052caa82b3be3b9175.mp3", "五十音", "五十音[ごじゅうおん]", "ごじゅうおん", "Japanese syllabary", "Noun", "6d97a94b1662a92880c31ed15a469cf6.mp3" },
                    { 4096, "JLPT2", "家から学校までの<b>道順</b>を教えてください。", "家[いえ]から 学校[がっこう]までの<b> 道順[みちじゅん]</b>を 教[おし]えてください。", "いえ から がっこう まで の <b>みちじゅん</b> を おしえて ください", "Please tell me the route from your house to the school.", "e9dc75aa7a3aeab60f24f4cdfd4b2a4e.mp3", "道順", "道順[みちじゅん]", "みちじゅん", "'route, itinerary'", "Noun", "c595e98eebfa826d50b1bc457d46e01b.mp3" },
                    { 4097, "JLPT2", "正しい<b>順序</b>で操作してください。", "正[ただ]しい<b> 順序[じゅんじょ]</b>で 操作[そうさ]してください。", "ただしい <b>じゅんじょ</b> で そうさ して ください", "Please carry out the operations in the correct order.", "07aaad50dd2f9c336cc065fa39ff0795.mp3", "順序", "順序[じゅんじょ]", "じゅんじょ", "order", "Noun", "212246e9d76bf43740cb3ac43dc237f9.mp3" },
                    { 4098, "JLPT2", "駅は<b>逆</b>方向です。", "駅[えき]は<b> 逆[ぎゃく]</b> 方向[ほうこう]です。", "えき は <b>ぎゃく</b>ほうこう です", "The station is in the opposite direction.", "47fc22b6e275e92eae9ff3139ae2c889.mp3", "逆", "逆[ぎゃく]", "ぎゃく", "'reverse, inverse'", "Adjectival Noun", "06131213269cb5faa6bae875fdb8d80b.mp3" },
                    { 4099, "JLPT1", "<b>運命</b>には逆らえないよ。", "<b> 運命[うんめい]</b>には 逆[さか]らえないよ。", "<b>うんめい</b> に は さからえない よ", "You cant go against fate.", "13f60bcebd73c7b343236ead32d2aa14.mp3", "運命", "運命[うんめい]", "うんめい", "'fate, fortune'", "Noun", "fd7c13c7f9b62f90b3883625e72cc96b.mp3" },
                    { 4100, "JLPT2", "親に<b>逆らう</b>のは良くない事です。", "親[おや]に<b> 逆[さか]らう</b>のは 良[よ]くない 事[こと]です。", "おや に <b>さからう</b> の は よくない こと です", "It is not a good thing to disobey your parents.", "fbb6fa53d310cade335a5ab85d7ad0e3.mp3", "逆らう", "逆[さか]らう", "さからう", "'disobey, go against'", "Verb", "6bdfc39f92eaf1398a09562544fd029e.mp3" },
                    { 4101, "JLPT2", "絵を<b>逆さ</b>にしてみてごらん。", "絵[え]を<b> 逆[さか]さ</b>にしてみてごらん。", "え を <b>さかさ</b> に して みて ごらん", "Try looking at the picture upside down.", "5612dac8b2102c8cd254b74ae934cee5.mp3", "逆さ", "逆[さか]さ", "さかさ", "'reverse, inversion'", "Adjectival Noun", "b80b98a1ea7ea2e1f92637c5ab5ea8c6.mp3" },
                    { 4102, "JLPT0", "それじゃあ上と下が<b>逆さま</b>だよ。", "それじゃあ 上[うえ]と 下[した]が<b> 逆[さか]さま</b>だよ。", "それじゃあ うえ と した が <b>さかさま</b> だ よ", "The way you have it is upside down.", "64d3d6c88824150cdf53536bedef1fbb.mp3", "逆さま", "逆[さか]さま", "さかさま", "'upside-down, reverse'", "Adjectival Noun", "6ef7d8a86cc1b965ba121afa7fa7b184.mp3" },
                    { 4103, "JLPT2", "一列に並んで<b>前進</b>して下さい。", "一列[いちれつ]に 並[なら]んで<b> 前進[ぜんしん]</b>して 下[くだ]さい。", "いちれつ に ならんで <b>ぜんしん</b> して ください", "Please form a line and proceed forwards.", "c0e733c8b31cc01c0670d99bd9af3d9a.mp3", "前進", "前進[ぜんしん]", "ぜんしん", "advancement", "Verbal Noun", "4da6ddea8ff25901059155eb8d48cc96.mp3" },
                    { 4104, "JLPT2", "店の前に長い<b>行列</b>ができていますよ。", "店[みせ]の 前[まえ]に 長[なが]い<b> 行列[ぎょうれつ]</b>ができていますよ。", "みせ の まえ に ながい <b>ぎょうれつ</b> が できて います よ", "There is a long line in front of the shop.", "a714d7eb87a9a3a4b7d097fe9c369a6e.mp3", "行列", "行列[ぎょうれつ]", "ぎょうれつ", "'queue, line'", "Verbal Noun", "3f8d3f9df9c79fcb93c8d1f4c0500111.mp3" },
                    { 4105, "JLPT1", "体育館に行って<b>整列</b>しなさい。", "体育館[たいいくかん]に 行[い]って<b> 整列[せいれつ]</b>しなさい。", "たいいくかん に いって <b>せいれつ</b> しなさい", "Go to the gymnasium and line up.", "d156825ebf22429f6fe4155123160005.mp3", "整列", "整列[せいれつ]", "せいれつ", "'row, line'", "Verbal Noun", "d9a917f1e8c883ca50c049372c28c8ee.mp3" },
                    { 4106, "JLPT2", "<b>列車</b>がホームに入ってきた。", "<b> 列車[れっしゃ]</b>がホームに 入[はい]ってきた。", "<b>れっしゃ</b> が ほーむ に はいって きた", "The train has arrived at the platform.", "02c4c61882aa7ec50fd213c374a171d1.mp3", "列車", "列車[れっしゃ]", "れっしゃ", "train", "Noun", "7826120771ea938ac35b3dbd45e9544e.mp3" },
                    { 4107, "JLPT2", "<b>縦</b>2列に並んでください。", "<b> 縦[たて]</b> 2 列[れつ]に 並[なら]んでください。", "<b>たて</b> 2 れつ に ならんで ください", "Please line up in two rows lengthways.", "8b4c250829f6f6ab47cb25301a1204aa.mp3", "縦", "縦[たて]", "たて", "'lengthways, vertical'", "Noun", "c0a09f804f8ff8a398276e2d20ef76ed.mp3" },
                    { 4108, "JLPT2", "日本は<b>列島</b>です。", "日本[にっぽん]は<b> 列島[れっとう]</b>です。", "にっぽん は <b>れっとう</b> です", "Japan is an archipelago.", "feb33e241e678272f1ef95dd2defd5b7.mp3", "列島", "列島[れっとう]", "れっとう", "archipelago", "Noun", "3715329c33f179fcb6c03925f426e504.mp3" },
                    { 4109, "JLPT0", "その店に<b>何十</b>人も行列していたよ。", "その 店[みせ]に<b> 何十[なんじゅう]</b> 人[にん]も 行列[ぎょうれつ]していたよ。", "その みせ に <b>なんじゅう</b>にん も ぎょうれつ して いた よ", "Tens of people formed a line to the shop.", "9fa7fc65059b250e4fc7d4e975a843ad.mp3", "何十", "何十[なんじゅう]", "なんじゅう", "several tens", "Noun", "e7a51b5d7cf940528f90a9568f4c1114.mp3" },
                    { 4110, "JLPT2", "店の前に長い<b>列</b>ができていたね。", "店[みせ]の 前[まえ]に 長[なが]い<b> 列[れつ]</b>ができていたね。", "みせ の まえ に ながい <b>れつ</b> が できて いた ね", "A long line formed in front of the shop.", "5a310c872117aed1c628b8e8f50e487d.mp3", "列", "列[れつ]", "れつ", "'row, line'", "Noun", "dbcbfcfa2f6d7fdcce24fd16e03b15cf.mp3" },
                    { 4111, "JLPT2", "<b>実例</b>を使って説明してください。", "<b> 実例[じつれい]</b>を 使[つか]って 説明[せつめい]してください。", "<b>じつれい</b> を つかって せつめい して ください", "Please explain by using an actual example.", "d17cfa8e5436af0fe6d54be957b0c858.mp3", "実例", "実例[じつれい]", "じつれい", "'example, instance'", "Noun", "b759845ab0212d0a970f860a3330112a.mp3" },
                    { 4112, "JLPT2", "<b>例外</b>は認めません。", "<b> 例外[れいがい]</b>は 認[みと]めません。", "<b>れいがい</b> は みとめません", "Exceptions are not allowed.", "a27bdf39f3d76882144fd4b9f791bc0c.mp3", "例外", "例外[れいがい]", "れいがい", "exception", "Noun", "cfc56e6b0f7c371cd7982f1d8d220b97.mp3" },
                    { 4113, "JLPT0", "<b>用例</b>を使って説明してください。", "<b> 用例[ようれい]</b>を 使[つか]って 説明[せつめい]してください。", "<b>ようれい</b> を つかって せつめい して ください", "Please explain by using examples.", "a77abd3db5c42c94bd5c6371c0758627.mp3", "用例", "用例[ようれい]", "ようれい", "'example, illustration'", "Noun", "22fdac4926aa0633e0b7cf6d0abc55f5.mp3" },
                    { 4114, "JLPT2", "彼は彼女をバラに<b>例えた</b>んだ。", "彼[かれ]は 彼女[かのじょ]をバラに<b> 例[たと]えた</b>んだ。", "かれ は かのじょ を ばら に <b>たとえた</b> ん だ", "He compared her to a rose.", "b4cace17217754e7962322a81b7188d9.mp3", "例える", "例[たと]える", "たとえる", "'compare, liken'", "Verb", "3de4e497f47c2750d6dfe55369863390.mp3" },
