                    { 5765, "JLPT1", "<b>大概</b>、風邪は寝ていれば治ります。", "<b> 大概[たいがい]</b>、 風邪[かぜ]は 寝[ね]ていれば 治[なお]ります。", "<b>たいがい</b> かぜ は ねて いれば なおります", "'Generally, colds get better after you get some sleep.'", "a0b38e5a7ba404b4d13035e13fb25e78.mp3", "大概", "大概[たいがい]", "たいがい", "'generally, probably'", "Adverb", "900487aba47c889568a682145a04be86.mp3" },
