                    { 5771, "JLPT2", "彼の顔に<b>玉</b>のような汗が流れていたの。", "彼[かれ]の 顔[かお]に<b> 玉[たま]</b>のような 汗[あせ]が 流[なが]れていたの。", "かれ の かお に <b>たま</b> の よう な あせ が ながれて いた の", "Beads of sweat rolled down his face.", "b2328a5f71b6a3d6d2f8ee27543c726c.mp3", "玉", "玉[たま]", "たま", "'bead, ball'", "Noun", "33277b7584e9c8146e5b90675f8a4195.mp3" },
