                    { 5774, "JLPT2", "日本には<b>天皇</b>がいます。", "日本[にっぽん]には<b> 天皇[てんのう]</b>がいます。", "にっぽん に は <b>てんのう</b> が います", "Japan has an emperor.", "758eaf8ed56f744d0ae360d63ac412f0.mp3", "天皇", "天皇[てんのう]", "てんのう", "emperor", "Noun", "407fb701feb27fb27f00c2f59af90d2e.mp3" },
                    { 5775, "JLPT2", "お風呂に花を<b>浮かべて</b>入ったの。", "お 風呂[ふろ]に 花[はな]を<b> 浮[う]かべて</b> 入[はい]ったの。", "おふろ に はな を <b>うかべて</b> はいった の", "I floated some flowers in the bath and then got in.", "d22b0b64e0db3e2a08704596b69d3887.mp3", "浮かべる", "浮[う]かべる", "うかべる", "set afloat", "Verb", "200aac8fbadf4a63d11a2fba12eb0b7b.mp3" },
