                    { 5779, "JLPT2", "<b>哲学</b>は興味深い学問です。", "<b> 哲学[てつがく]</b>は 興味深[きょうみぶか]い 学問[がくもん]です。", "<b>てつがく</b> は きょうみぶかい がくもん です", "Philosophy is an interesting field of study.", "1d335dd5788fcaa1ff7783e5a4b69e3f.mp3", "哲学", "哲学[てつがく]", "てつがく", "philosophy", "Noun", "7f11fe4c0255fd9bf7e0d7ab7ec1ebcb.mp3" },
