                    { 5783, "JLPT2", "この<b>綱</b>は直径20cmあるそうです。", "この<b> 綱[つな]</b>は 直径20cm[ちょっけい 20 せんち]あるそうです。", "この <b>つな</b> は ちょっけい 20 せんち ある そう です", "I hear the diameter of the rope is 20cm.", "f3c9ee6536273e48faa226e2c57ad221.mp3", "綱", "綱[つな]", "つな", "'rope, line'", "Noun", "d51aa897aac4c560bb7fdf318b97499f.mp3" },
